import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '100vh',
        width: '10%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-around',
        paddingTop: '20px',
        borderColor: 'black',
        borderWidth: '1px',
    },
    menuIconContainer: {
        borderColor: 'black',
        borderWidth: '1px',
    },
    menuContentContainer: {
        width: '100%',
        height: '70%',
        borderColor: 'black',
        borderWidth: '1px',
    }
});
